class Card extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const { pais, capital, poblacion} = this.props;

        return (
            <div>
                <h2>{pais}</h2>
                <p>Capital: {capital}</p>
                <p>Poblaci√≥n: {poblacion}</p>
            </div>
        );
    }
}

export default Card;
